import { Component, OnInit } from '@angular/core';
import { AddCategoryRequest } from '../models/add-category-request.model';
import { CategoryService } from '../services/category.service';
import { Router } from '@angular/router';
import { SignalRService } from '../services/signal-rservice.service';
import { MatSnackBar } from '@angular/material/snack-bar';

CategoryService
SignalRService

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent implements OnInit {

  model: AddCategoryRequest
  private readonly _signalRService: SignalRService;
  private readonly _snackBar: MatSnackBar;
  message!: string;

  constructor(private categoryService: CategoryService, private router: Router, private signalRService: SignalRService, private snackBar: MatSnackBar) {
    this.model = {
      name: '',
      urlHandle: ''
    },
      this._signalRService = signalRService;
    this._snackBar = snackBar;
  }


  ngOnInit() {
    this._signalRService.init("");
    this._signalRService.messages.subscribe(message => {
      this._snackBar.open(message);
    });
  }

  AddCategory() {
    this.categoryService.addCategory(this.model).subscribe({
      next: (response) => {
        this.router.navigateByUrl('/admin/categories');
      },
      error: (error) => {
        console.log("this was failed");
      }
    })
  }

  send() {
    this._signalRService.send(this.message).subscribe(() => { });
  }
}
